import styled from 'styled-components';
import { Formik } from 'formik';

export const FormWrapper = styled.div`
  width: 60%;

  padding: 3rem 1.5rem;
  display: flex;
  flex: columns;
  align-items: center;

  background-color: pink;
  box-shadow: 0rem 0.5rem 3.5rem blue;
`;
